import Logo from '../../images/logo.svg';
import Features from './Features';
import classes from "./header.module.css";
import drop from "./Drop.module.css";
import Company from "./Company";
import Buttons from './Buttons';

import Menu from '../../images/icon-menu.svg';
// import Arrowup from "./images/icon-arrow-down.svg";
// import Arrorup from "./images/icon-arrow-up.svg";
function Header(){
    var link = "#";
    
    return (
    <header className={classes.Heading}>
        <div><img src={Logo} alt="Snap" /></div>
        <div className={classes.HeaderNav}>
            <button><img src={Menu} alt="menu"/></button>
            <nav >
            <ol>
                <li className={drop.Drop}>Features
                    <Features />
                </li>
                <li className={drop.Drop}>Company
                    <Company />
                </li>
                <li><a href={link}>Careers</a></li>
                <li><a href={link}>About</a></li>
            </ol>
            </nav>
            <div>
                <Buttons Btn={1} Content="Login"/>
                <Buttons Btn={2} Content="Register"/>
            </div>
        </div>
        
    </header>
    );
}
export default Header;
